import React, { use, useEffect, useState } from "react";
import logo from "../../assets/images/logo.png";
import heart from "../../assets/images/heart.png";
import cartImg from "../../assets/images/cart.png";
import { Link } from "react-router-dom";
import { useCart, useNav } from "../../context";
import "./Header.css";
import Navigation from "../Navigation";
import { menu } from "../../assets";
import { useMediaQuery } from "@react-hook/media-query";
import SearchBar from "../SearchBar";
function Header() {
  const { openCart, cartQuantity } = useCart();
  const { isNavOpen, openNav } = useNav();
  const [showMenu, setShowMenu] = useState(false);

  const isDesktop = useMediaQuery("screen and (min-width: 720px)");
  // useEffect(() => {
  //   if (isDesktop) {
  //     closeNav();
  //   }
  // }, [isDesktop, closeNav]);

  const onNavClose = () => {
    const menuBtn = document.getElementById("menu-btn");
    menuBtn?.focus();
  };
  useEffect(() => {
    const handleScroll = () => {
      const header = document.querySelector("header");
      const headerHeight = header
        ? header.getBoundingClientRect().height + 50
        : 80;
      setShowMenu(window.scrollY > headerHeight);
    };
    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  return (
    <header>
      <div className="header-container">
        <div className="header-left">
          <Link
            tabIndex={showMenu ? -1 : undefined}
            aria-hidden={showMenu}
            to={"/"}
          >
            {" "}
            <img className="logo" src={logo} alt="logo" />
          </Link>
          <div style={{ display: "flex" }}>
            <button
              tabIndex={showMenu ? -1 : undefined}
              aria-hidden={showMenu}
              id="sign-up"
            >
              Sign Up
            </button>
            <button
              tabIndex={showMenu ? -1 : undefined}
              aria-hidden={showMenu}
              id="log-in"
            >
              Log In
            </button>
          </div>
        </div>

        <div className="header-right">
          <button
            tabIndex={showMenu ? -1 : undefined}
            aria-hidden={showMenu}
            aria-controls="nav"
            id={!showMenu ? "menu-btn" : undefined}
            aria-expanded={!isDesktop ? isNavOpen : undefined}
            className="menu-btn"
            onClick={openNav}
          >
            <img className="icon" src={menu} alt="menu" />
          </button>

          <SearchBar
            tabIndex={showMenu ? -1 : undefined}
            aria-hidden={showMenu}
          />
          <Link
            tabIndex={showMenu ? -1 : undefined}
            aria-hidden={showMenu}
            to={"/favorites"}
          >
            <img className="heart" src={heart} alt="heart" />
          </Link>
          <div>
            <button
              tabIndex={showMenu ? -1 : undefined}
              aria-hidden={showMenu}
              onClick={openCart}
            >
              <img className="cart" src={cartImg} alt="cart" />
            </button>
            {cartQuantity > 0 && (
              <button
                tabIndex={showMenu ? -1 : undefined}
                aria-hidden={showMenu}
                className="cart-badge"
                onClick={openCart}
              >
                {cartQuantity}
              </button>
            )}
          </div>
        </div>
      </div>
      <Navigation disabled={showMenu && !isNavOpen} onClose={onNavClose} />

      <div
        className={`sticky-header ${showMenu && !isNavOpen ? "visible" : ""}`}
      >
        <button
          aria-controls="nav"
          aria-expanded={!isDesktop ? isNavOpen : undefined}
          className="menu-btn"
          id={showMenu ? "menu-btn" : undefined}
          onClick={openNav}
        >
          <img className="icon" src={menu} alt="menu" />
        </button>
      </div>
    </header>
  );
}

export default Header;
